import React from 'react';

// Importa los componentes desde la carpeta screen
import Login from './screen/login/Login';
import Register from './screen/register/Register';

function App() {
  return (
    <div className="App">
      <h1>My React App</h1>
      {/* Agrega los componentes Login y Register */}
      <Login />
      <Register />
    </div>
  );
}

export default App;
